import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import miroutes from './config/routes';
import AdminHome from './pages/Admin';

import './App.scss';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/admin" element={<AdminHome />} />
      </Routes>
    </Router>
  );
}

export default App;
